import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
import '../node_modules/bootstrap/dist/js/bootstrap.bundle';
// import Img1 from './img/slid1.jpg';

const Contact = () => {
  return (
    <>
      <div className="container-fluid nav-bg aboutcss">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className=" row d-flex align-items-center mt-5 mb-5 ">
              <div className=" col-md-6 pt-0 pt-lg-0 order-1 order-lg-1 d-flex justify-content-center flex-column">
                <h1 className=" mt-1 text-capitalize"><strong className=" text-"> <i> Contact us</i></strong> any time any where </h1>
                <img className=" mt-1 abutimg" src='https://image.freepik.com/free-vector/flat-design-illustration-customer-support_23-2148887720.jpg' alt="svg img"></img>
              </div>
              <div className="col-md-6 pt-5 pt-lg-0 order-1 order-lg-1 text-end " >

              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
};
export default Contact;
